description:
Japan's First Space Commander - Koichi Wakata's Mission

Technology Documentary hosted by Kensuke Obara, published by NHK in 2013 - English narration


Information
------------------------------

On November 7, Astronaut Koichi Wakata embarked on his 4th mission into space. He is the first Japanese chosen to serve as commander of the International Space Station. This past summer, Wakata went through the final phase of training to test his competence as commander. How will Wakata unite a multinational crew, speaking different languages? This program follows his challenging days before lift-off.

